import React, { useState } from "react";
import { Link } from "react-router-dom";
import styled from 'styled-components';
import CartRow from './cart';
import CartRowBreve from "./cart_breve";
import {Title} from "./Car_Long_Term";
const Container = styled.div`
    font-family: Calibri, Candara, Segoe, "Segoe UI", Optima, Arial, sans-serif;
    color: #F1F1F1;
    text-align: center;
    margin-left: 20px;
    margin-right: 20px;
    padding-bottom: 60px;
    @media only all and (max-width: 570px) {
        margin-top: 95px;
    }
`;
/*
const Title = styled.div`
    font-size: 35px;
    text-transform: uppercase;
    @media only all and (max-width: 570px) {
        font-size: 26px;
    }
`;
*/
export default function Car_Short_Term() {
    const [dates, setData] = useState([]);
    async function componentDidMount() {
        try {
            const res = await fetch('/api/car/breve/auto');
            const data = await res.json();
            setData(data);
        } catch (e) {
            console.log(e);
        }
    }
    componentDidMount();
    return(
        <>
        <Container>
            <Title>Noleggio a breve termine</Title>
        </Container>
        <CartRowBreve date={dates}/>
        </>
    );
}
